 import 'dart:js';import 'package:flutter/material.dart';import 'package:flutter_auth_login/view/login_page.dart';import 'package:flutter_auth_login/view/second.dart';class  RouteGenerator{      static   final  RouteGenerator _generator=RouteGenerator.init();      static RouteGenerator  get router => _generator;      RouteGenerator.init();      Route?  onGenerator(RouteSettings  settings){        switch(settings.name){           case 'login':              return  _navigate(AuthLogin());          case '/':              return  _navigate(SecondPage());        }      }      MaterialPageRoute  _navigate(Widget  widget){          return  MaterialPageRoute(builder: (context)=> widget);      } }